import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <header style={headerStyle}>
      <h1>
        <a style={aStyle} href="/">
          Ashkan's React App
        </a>
      </h1>
      <Link style={linkStyle} to="/sv">
        Sorting-Visualizer{" "}
      </Link>
      |{" "}
      <Link style={linkStyle} to="/covid19">
        Covid19-Tracker{" "}
      </Link>
      |{" "}
      <Link style={linkStyle} to="/covid_summary">
        Covid Summary{" "}
      </Link>
      |{" "}
      <Link style={linkStyle} to="/ml">
        DataScience Projects{" "}
      </Link>
    </header>
  );
}

const headerStyle = {
  background: "#333",
  color: "#fff",
  textAlign: "center",
  padding: "10px",
};

const linkStyle = {
  color: "#fff",
  textDecoration: "none",
};
const aStyle = {
  color: "#fff",
  textDecoration: "none",
};

export default Header;
